  `date_created` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT 'create time',
  `date_updated` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT 'update time',
